/**
 *
 * @param data 判断真假判断所需的数据
 */
// const isBlanks<T> = (data:T):boolean => {
//     return !data;
// }
function isBlanks<T> (data: T):boolean {
    console.log("!data: ", data);
    return !data;
}

export default isBlanks;
